function App() {

  numba1 = document.getElementById("numba1");
  numba1.addEventListener("mousemove", function(e) {
    let x = e.clientX;
    let y = e.clientY;
    numba1.style.transform = `translate3d(${x}px, ${y}px, 35px)`;
  });

  return (
    <div className="App">
      <div id="numba1" class="bg-black w-[30vw] h-[10vh] absolute top-[50vh] left-[50vw] transition duration-1000" style={{transform: `translate3d(6px, 0px, 35px)`}}></div>
    </div>
  );
}
